description:
Kittie is a Canadian all-female metal band from London, Ontario. The band rose to success in 1999 when the track &quot;Brackish&quot; from their debut album Spit became a hit single. The band also supported Slipknot during the early 2000s on Slipknot's UK tour, heightening the band's popularity.


